    true,nt"url": null,nt"notes": "The Central Altitude Reservation Function
    (CARF) supports United States peace and war plan objectives and other special activities.
     The CARF is responsible for coordinating military and civilian altitude reservations
    for operations within the National Airspace System (NAS).CARF personnel must be
    able to determine when military operations, national security aircraft operations,
    and other civilian emergency operations require special traffic management coordination.
     CARF is also the coordination point for all Open Skies Treaty Operations.CARF
    is being enhance as part of AIM Segment 1.   No plans to enhance CARF after Segment
